import React from 'react';
import classes from "./profile.module.css";
import Preloader from "../../common/preloader/preloader";

const Profile = (props) => {
    console.log(props);
    if (!props.profile) {
        return <Preloader/>
    } else {
        return (
            <div className={classes.informationProfile}>
                <div className={classes.fotoProfile}>
                    <img src={ props.profile.photos.large}/>
                </div>
                <div className={classes.dataUser}>
                    <div className={classes.name}>
                        <p>{props.profile.fullName}</p>
                    </div>
                    <div className={classes.item}>Date of Birth: 2 january</div>
                    <div className={classes.item}>Minsk</div>
                    <div className={classes.item}>BSU'11</div>
                    <div className={classes.item}>{props.profile.website===null ?props.profile.website : 'Отсутствует' }</div>
                </div>
            </div>
        );
    }
}
export default Profile;
